import React, { Component } from "react";

// import updateCoordinates from './Car';

import * as THREE from 'three-full';
import vxShader from './main.vert';
import fragShader from './main.frag';

import * as dat from 'dat.gui'
import parse from 'color-parse';

import car_file from './resources/RetroRacerOrangeRotated.obj'
import {Colors} from "three-full/sources/constants";
import {warn} from "three-full/sources/polyfills";
import {Map2D} from "./Map2D";

const base64_imgData = "data:image/png;base64,";

let scene, camera, renderer,controls;

let facenumber = 0;

// Lights
const light_am_color = 0xAAAAAA;
const light_spot_color = 0xDDDDDD;
const light_spot_intensity = 0.7;
const light_spot_position = {x: 0, y: 200, z: 0,}
const light_spot_camera_near = 50.0;
const light_spot_shadow_darkness = 0.35;

export const mesh_size = 200;
export const inner_size = 10;

scene = new THREE.Scene();

export class ViewArea extends Component {

    constructor(props) {
        super(props);

        this.canvasRef = React.createRef();
        this.divRef = React.createRef();

        scene.backgroundColor = 0xff0000;
        this.camera = new THREE.PerspectiveCamera(90, 1, 0.1, 1000);

        this.camera.position.z = 100;
        this.camera.position.x = 100;
        this.camera.position.y = 100;

        const geometry = new THREE.SphereGeometry(5, mesh_size, mesh_size);
        this.geometry = geometry;
        const material = new THREE.MeshBasicMaterial({color: 0xff0000});
        const sphere = new THREE.Mesh(geometry, material);
        sphere.receiveShadow = true;
        sphere.castShadow = true;

        scene.add(sphere);

        this.facenumber = 0;

        const img = document.createElement('img');
        img.crossOrigin = "Anonymous";
        let canvas;

        const getH = function (dir) {

            dir.az = 360 - dir.az + 180;
            dir.az = dir.az % 360;

            const x = Math.floor(canvas.width * dir.az / 360);
            const y = Math.floor(canvas.height * (dir.h + 90) / 180);
            const pixelData = canvas.getContext('2d').getImageData(x, y, 1, 1).data;
            const h = (100 + pixelData[0] / 10) / 100;
            // console.log(h);
            return h;
        };

        const position2Dir = function (position) {
            let az = null;
            let h = null;

            const vector = new THREE.Vector3(position.x, position.y, position.z);
            const length = vector.length();

            const hd = Math.sqrt(Math.pow(position.x, 2) + Math.pow(position.z, 2)) / length;

            h = Math.atan((position.y / length) / hd) / Math.PI * 180;
            h *= -1;

            az = Math.atan((position.z / hd) / (position.x / hd));
            //if (lazerJS.projectName == 'Export') {
            //    az += Math.PI / 2;
            // }

            if (position.x < 0 && position.z > 0) az = Math.PI + az;
            if (position.x < 0 && position.z < 0) az = Math.PI + az;
            if (position.x > 0 && position.z < 0) az = Math.PI * 2 + az;

            az = az / Math.PI * 180;

            if (isNaN(az)) az = 0;

            return {
                az: az,
                h: h
            };
        };

        const texture = new THREE.Texture();
        texture.image = img;

        img.src = base64_imgData;

        const material1 = new THREE.MeshBasicMaterial({
            side: THREE.DoubleSide,
            shading: THREE.SmoothShading,
            map: texture
        });

        const mesh = new THREE.Mesh(geometry, material1);

        img.onload = function () {
            texture.needsUpdate = true;

            canvas = document.createElement('canvas');
            canvas.width = img.width;
            canvas.height = img.height;
            canvas.getContext('2d').drawImage(img, 0, 0, img.width, img.height);

            console.log('Vertex count: ' + geometry.vertices.length)

            for (let i = 0, l = geometry.vertices.length; i < l; i++) {
                const dir = position2Dir(geometry.vertices[i]);
                const h = getH(dir);
                const vector = new THREE.Vector3();
                vector.set(geometry.vertices[i].x, geometry.vertices[i].y, geometry.vertices[i].z);
                vector.setLength(50 + 100 * h);
                geometry.vertices[i].x = vector.x;
                geometry.vertices[i].y = vector.y;
                geometry.vertices[i].z = vector.z;
            }

            console.log(geometry.vertices[0])

            geometry.verticesNeedUpdate = true;
            geometry.normalsNeedUpdate = true;
            geometry.computeVertexNormals();
            geometry.computeFaceNormals();

            scene.add(mesh);

            // const helper = new THREE.VertexNormalsHelper(mesh, 2, 0x00ff00, 1);
            //
            // scene.add(helper);


            // const wireframe = new THREE.WireframeGeometry( geometry );
            //
            // const line = new THREE.LineSegments( wireframe );
            // line.material.depthTest = false;
            // line.material.opacity = 0.25;
            // line.material.transparent = true;

            // scene.add( line );
        };

        this.map = new Map2D(geometry);

        scene.add(this.map.car);

        // Add directional light
        const spot_light = new THREE.SpotLight(light_spot_color, light_spot_intensity);
        spot_light.position.set(light_spot_position.x, light_spot_position.y, light_spot_position.z);
        spot_light.target = scene;
        spot_light.castShadow = true;
        spot_light.receiveShadow = true;
        spot_light.shadowDarkness = light_spot_shadow_darkness;
        spot_light.shadowCameraNear = light_spot_camera_near;
        scene.add(spot_light);

        document.addEventListener("keydown", this.map.onKeyDown);

        this.map.updateCoordinates();
    }

    componentDidMount() {
        const canvas = this.canvasRef.current;
        if (!canvas) {
            return;
        }

        this.controls = new THREE.OrbitControls(this.camera, this.canvasRef.current);
        this.controls.update();

        const gl = canvas.getContext('webgl2');
        if (!gl) {
            return;
        }

        const renderer = new THREE.WebGLRenderer({canvas: canvas, context: gl});
        renderer.setSize(canvas.width, canvas.height);

        this.prevTime = new Date();

        const renderLoopTick = () => {
            // Handle resize
            if (this.divRef.current.offsetWidth !== canvas.width ||
                this.divRef.current.offsetHeight !== canvas.height) {
                console.log(`Resizing canvas: ${this.divRef.current.offsetWidth}x${this.divRef.current.offsetHeight}`);

                canvas.width = this.divRef.current.offsetWidth;
                canvas.height = this.divRef.current.offsetHeight;

                renderer.setSize(canvas.width, canvas.height);

                const d = new THREE.Vector3();
                const q = new THREE.Quaternion();
                const s = new THREE.Vector3();
                this.camera.matrixWorld.decompose(d, q, s);
                this.camera.position.copy(d);
                this.camera.quaternion.copy(q);
                this.camera.scale.copy(s);

                this.camera = new THREE.PerspectiveCamera(90, canvas.width / canvas.height, this.camera.near, this.camera.far);

                this.camera.position.set(d.x, d.y, d.z);
                this.camera.quaternion.clone(q);
                this.camera.scale.set(s.x, s.y, s.z);
                this.controls = new THREE.OrbitControls(this.camera, canvas);
            }

            // this.updateCoordinates();

            const curTime = new Date();

            gl.viewport(0, 0, canvas.width, canvas.height);
            gl.clearColor(0.2, 0.2, 0.2, 1.0);
            gl.clear(gl.COLOR_BUFFER_BIT);

            this.controls.update();

            renderer.render(scene, this.camera);

            this.prevTime = curTime;

            requestAnimationFrame(renderLoopTick);
        }

        requestAnimationFrame(renderLoopTick);

    }

    render() {
        return (
            <div ref={this.divRef} style={{width: "100%", height: "100vh"}}>
                <canvas
                    ref={this.canvasRef}
                    style={{width: "100%", height: "100%"}}
                />
            </div>
        );
    }
}
